import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';


// import React from 'react';
// import ReactDOM from 'react-dom/client';
// import 'bootstrap/dist/css/bootstrap.min.css';

function LandingPage() {
  return (
    <div className="container-fluid vh-100 d-flex align-items-center justify-content-center bg-light">
      <div className="row w-100">
        <div className="col-md-6 d-flex flex-column justify-content-center align-items-start p-5">
          <h1 className="display-4 fw-bold text-primary mb-4">Welcome to the Visa Booking System</h1>
          <p className="lead text-secondary mb-4">
            Easily apply, track, and manage your visa applications with our simple and secure platform.
          </p>
          <a href="/book" className="btn btn-primary btn-lg">
            Get Started
          </a>
        </div>
        <div className="col-md-6 d-none d-md-block">
          <img
            src="https://www.shutterstock.com/image-vector/flat-vector-illustration-passport-visa-600w-2183460111.jpg"
            alt="Visa Illustration"
            className="img-fluid rounded shadow"
          />
        </div>
      </div>
    </div>
  );
}




const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(

    <App />

);
